import { Layout } from 'antd'
import React, { Component } from 'react'
import UserHead from '../../components/UserHead'

const {Content} = Layout
export default class Index extends Component {
    render() {
        return (
            <div>
                <UserHead />
                <Layout>
                    <Content>
                        
                    </Content>
                </Layout>
            </div>
        )
    }
}
